description:
bán đất đường an đồn 6, p an hải bắc q. sơn trà, tp đà nẵng . .diện tích: 220 m² (10 x 22m). giá 23,5 tỷ , đường 7,5m vỉ hè 5m.+ vị trí: đẹp gần biển phạm văn đồng, phù hợp xây dựng khách sạn cao tầng và căn hộ...+ kinh doanh thuận lợi khách sạn, căn hộ, văn phòng cho thuê.khu dân trí cao, an ninh tốt.xung quanh có nhiều trường học, chợ và các khuôn viên công cộng;
+ giá bán: 23,5 tỷ
liên hệ xem nhà đất: 0898407577 - 0981986909 (tuyền)

